import React, { Component } from 'react';
import { ImageBackground, StyleSheet,Image, Text, TouchableOpacity, View } from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { TextInput } from 'react-native-gesture-handler';
import Checkbox from 'expo-checkbox';





export default class Login extends Component{


    constructor(props){
        super(props)
        this.state={
            email:'',
            password:''

        }
    }


    render(){
        return(
           <View style={{
            flexDirection:'column',
            flex:1,
           }}>
            <View style={{
                height:'18%',
                width:'100%',
                flexDirection:'row',
                backgroundColor:'#ffffff'
            }}>
                <View>
                    <ImageBackground source={require('./images/WhatsApp_Image_2023-02-28_at_5.37.06_PM-removebg-preview.png')}
                    style={{height:'90%',
                    width:190,
                    marginTop:15
                    }}
                    
                    ></ImageBackground>
                    
                </View>
                <View>
                <Text style={{fontFamily:'YanoneKaffeesatz',fontSize:75,color:'#521956',paddingTop:40}}>EIOMAS</Text>
                <Text style={{fontFamily:'YanoneKaffeesatz',fontSize:15,color:'#521956',paddingTop:5,fontWeight:"bold"}}>EMAAN INSTITUTE OF MANAGEMENT AND SCIENCE</Text>

                </View>
                <View style={{alignItems:'center',justifyContent:'center',shadowRadius:2, backgroundColor:'#ececec',height:40, width:'12%',alignSelf:'center',marginRight:20,marginLeft:570}}>
                <LinearGradient
                       colors={['#e9e7e7', '#f0eef0', '#ffffff']}
                       style={{width:"100%",height:"100%",justifyContent:'center',alignSelf:'center',alignItems:'center'}}>

                        <TouchableOpacity>
                        <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"bold"}}>About us</Text>
                        </TouchableOpacity>
                    </LinearGradient>
                    
                </View>
                <View style={{alignItems:'center',justifyContent:'center',shadowRadius:2, backgroundColor:'#ececec',height:40, width:'12%',alignSelf:'center',marginRight:20}}>
                <LinearGradient
                       colors={['#e9e7e7', '#f0eef0', '#ffffff']}
                       style={{width:"100%",height:"100%",justifyContent:'center',alignSelf:'center',alignItems:'center'}}>
                        <TouchableOpacity>
                        <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"bold"}}>Contact us</Text>



                        </TouchableOpacity>
                        
                                            </LinearGradient>
                    
                </View>
                <View style={{alignItems:'center',justifyContent:'center',shadowRadius:2, backgroundColor:'#ececec',height:40, width:'12%',alignSelf:'center',marginRight:20}}>
                <LinearGradient
                       colors={['#e9e7e7', '#f0eef0', '#ffffff']}
                       style={{width:"100%",height:"100%",justifyContent:'center',alignSelf:'center',alignItems:'center'}}>
                        <TouchableOpacity>
                        <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"bold"}}>Help me</Text>

                        </TouchableOpacity>

                    </LinearGradient>
                    
                </View>
                
                


                
                
                
                </View>
            <View style={{
                
                width:'100%',
                height:'100%'
            }}>
                 <LinearGradient 
      colors={['#35123e', '#622f6f']} 
      start={{
        x: 0,
        y: 0
      }}
      end={{
        x: 1,
        y: 1
      }}
      style={styles.box}>
        <View style={{flexDirection:'row'}}>
      <View style={{flexDirection:'column'}}>
       <Text style={{fontFamily:'YanoneKaffeesatz',fontSize:34,fontWeight:'300',color:'#ffffff',paddingTop:225,paddingLeft:40}}>Welcome Back To </Text> 
       <Text style={{fontFamily:'YanoneKaffeesatz',fontSize:34,fontWeight:'300',color:'#ffffff',paddingTop:22,paddingLeft:40}}>EIOMAS Learning Management System</Text> 
       <View style={{

                    backgroundColor:'#EBC4FF',
                    marginTop:60,
                    height:230,
                    marginLeft:40,
                    width:550,
                    borderRadius:2,
                    alignContent:'center',
                    alignItems:'center',
                    alignSelf:'center'
                 }}>
                    <View style={styles.inputViewB}>
                        <TextInput style={
                            styles.TextInput
                        }
                        placeholder="Username"
                        placeholderTextColor="#003f5c"
                        onChangeText={(email) => this.setState({email})}
                        
                        />


                    </View>
                    <View style={styles.inputViewB}>
                        <TextInput style={
                            styles.TextInput
                        }
                        placeholder="Password"
                        placeholderTextColor="#003f5c"
                        onChangeText={(password) => this.setState({password})}
                        
                        />

                    </View>
                    <View style={{flexDirection:'row'}}>
                        <View style={{flexDirection:'row',marginTop:10}}>
                            <Checkbox style={{alignSelf:'center',justifyContent:'space-evenly',marginRight:10,marginBottom:20}}>
                            </Checkbox>
                        </View>
                        <Text style={{alignContent:'center',alignSelf:'center',marginTop:10,marginBottom:20}}>Remember me</Text>
                        <TouchableOpacity style={{
                                          color:'#287A6A',
                                          height:40,
                                          width:100,
                                          borderLeftColor:'#59B38C',
                                          borderLeftWidth:5,
                                          alignItems:"center",
                                          justifyContent:"center",
                                          alignSelf:"center",
                                          backgroundColor: '#B6FCDE',
                                          marginLeft:95
                        }}>Login</TouchableOpacity>
                    </View>


                 </View>



       



        
        
        </View> 
        </View>
        </LinearGradient>
                </View>
           </View>
        );

    }
}


const styles=StyleSheet.create({
    box: {
        width: '100%',
        height: '100%',
      },
    background: {
        position: 'absolute',
        left: 0,
        right: 0,
        top: 0,
        height: 350,
      },
      imageview:{
        width: 450,
        height:400,
        marginBottom:25,
        alignContent:'center',
        justifyContent:'center',
        alignItems:'center',
        alignSelf:'center'
      },
      inputViewA:{
        borderBottomWidth:2,
        borderBottomColor:'#FF595C',
        marginBottom:10,
        marginTop:30,
        alignSelf:'center',

  
        alignItems:'center',
        alignContent:'center',
        justifyContent:"space-evenly",
        backgroundColor: "#ffffff",
        borderRadius: 28,
        width: "15%",
        height: 55,
      },
      inputViewB:{
        borderBottomWidth:2,
        borderBottomColor:'#FF595C',
        marginTop:10,
        alignSelf:'center',
  
        alignItems:'center',
        alignContent:'center',
        justifyContent:"space-evenly",
        backgroundColor: "#ffffff",
        borderRadius: 28,
        width: "80%",
        height: 55,
      },
      TextInput:{
        alignContent:"center",
        justifyContent:"center",
        alignItems:"center",
        fontFamily:"monospace",
        width:"100%",
        paddingLeft:8,
        height:55
        
        
  
      },
      imageviewbackground:{
        height:1000,
        width:800,

      }

})
